import React, { Component } from "react";
import "../Css/Home.css";
import {Route, NavLink, HashRouter, Switch} from "react-router-dom";
import Contact from "../Pages/Contact.js";


class Home extends Component {

  renderPost = () => (
    <div className="post-loading">
      Multimedia student and a self-learning programmer through interesting projects.
    </div>
  )

  renderIntro = () => (
    <div className="intro">
      Ever since I got my first computer, I have been interested on how to do different things on it. It started out as me making simple 2D games for myself. As a very curious person this constant self-improvement has
      presisted for many years now. Even when I was going to school at Viljandi Kutseõppekeskus to become an Electrician I still took part in extra corricular activites like game development, IT hobby group and electronics hobby group.
      I also spend a lot of my time trying to code new things and working with electronics. Also one of the main point of why I have had this interest in programming is because theres always a problem that needs solving, even basic ones, and trying to find the most efficent way to solve a specific problem is always a nice challange.
      During my free time I also like doing different desings/concepts which you can check out <a>here</a>.
    </div>


  )

  render() {
    return (
      <div>
      <div className="bg">
        <div className="cnt">
          <h1 className="name">Mihkel Liblikman</h1>
            <div className="post-container">
              {this.renderPost()}
            </div>
        </div><br/>
      </div>
      <div className="intro">
        <h2 className="abt">About me</h2>
              {this.renderIntro()}
      </div>
      <div>
        <h2>ö</h2>
      </div>
      </div>

    );
  }
}

export default Home;
